class Solution(object):
    def findShortestSubArray(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        tempNums = nums.copy()
        tempNums.sort()
        degree = 0
        tempNum = tempNums[0]
        tempDegree = 1
        numsHasMaxDegree = [tempNums[0]]
        for i in range(1, len(tempNums)):
            if tempNums[i] == tempNum:
                tempDegree += 1
            else:
                if tempDegree > degree:
                    numsHasMaxDegree.clear()
                    numsHasMaxDegree.append(tempNum)
                elif tempDegree == degree:
                    numsHasMaxDegree.append(tempNum)
                tempNum = tempNums[i]
                degree = max(degree, tempDegree)
                tempDegree = 1

        if tempDegree > degree:
            numsHasMaxDegree.clear()
            numsHasMaxDegree.append(tempNum)
            degree = tempDegree
        elif tempDegree == degree:
            numsHasMaxDegree.append(tempNum)

        minContinusNumLength = len(nums)
        for num in numsHasMaxDegree:
            tempMaxDegree = degree
            tempMinContinusNumLength = 0
            for _num in nums:
                if _num == num:
                    tempMinContinusNumLength += 1
                    tempMaxDegree -= 1
                    if 0 == tempMaxDegree:
                        break
                elif 0 != tempMinContinusNumLength:
                    tempMinContinusNumLength += 1
            minContinusNumLength = min(minContinusNumLength, tempMinContinusNumLength)
        return minContinusNumLength



